-- drop and create databases

DROP DATABASE IF EXISTS `daiquiri_archive`;
CREATE DATABASE `daiquiri_archive`;

DROP DATABASE IF EXISTS `daiquiri_data_obs`;
CREATE DATABASE `daiquiri_data_obs`;

DROP DATABASE IF EXISTS `daiquiri_data_sim`;
CREATE DATABASE `daiquiri_data_sim`;

DROP DATABASE IF EXISTS `daiquiri_user_user`;
CREATE DATABASE `daiquiri_user_user`;

-- create tables

CREATE TABLE `daiquiri_archive`.`files` (
    `id`          CHAR(36) PRIMARY KEY NOT NULL,
    `timestamp`   DATETIME NOT NULL,
    `file`        VARCHAR(256) NOT NULL,
    `collection`  CHAR(32) NOT NULL,
    `path`        TEXT NOT NULL,
    `ra`          FLOAT NOT NULL,
    `de`          FLOAT NOT NULL
) ENGINE=MyISAM;
CREATE TABLE `daiquiri_data_obs`.`images` (
  `id` int(11),
  `RA` double,
  `DE` double,
  `preview` char(64),
  `fits` char(64),
  `links` char(64)
) ENGINE=MyISAM;
CREATE TABLE `daiquiri_data_obs`.`stars` (
  `id` int(11),
  `RA` int(11),
  `DE` double,
  `parallax` double
) ENGINE=MyISAM;
CREATE TABLE `daiquiri_data_sim`.`particles` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `x` double NOT NULL,
  `y` double NOT NULL,
  `z` double NOT NULL,
  `vx` double NOT NULL,
  `vy` double NOT NULL,
  `vz` double NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM;
CREATE TABLE `daiquiri_user_user`.`test` (
  `id` int(11),
  `ra` int(11),
  `de` double,
  `parallax` double
) ENGINE=MyISAM;

LOCK TABLES `daiquiri_archive`.`files` WRITE;
